// Cameron McCarty
// 09/18/2023

import formClass from "./classes.module.css"

function FormInput(p) {
    if (p.inpType === "Pwd") {
        return (
            <div className={formClass.labelGroup}>
            <label htmlFor="pwd">Password:</label>
            <input 
                className={p.isValid ? null : formClass.invalidInput}
                id="pwd" 
                type="passsword" 
                name="pwd"
                onChange={p.changeFunc}
                value={p.val}
                onBlur={p.blurFunc}
                />
            </div>
        )
    }
}

export default FormInput;
